var tipuesearch = {"pages": [{'title': 'About', 'text': '41023215 許嘉祐 \n 41023217 陳育瑋 \n 倉儲:  https://github.com/mdecd2023/2b-pj1bg20.git \n 網站:  https://mdecd2023.github.io/2b-pj1bg20 \n 本課程為協同產品設計實習, 每週上課時數為 4 小時, 其中兩小時為教學時段, 另兩小時為實習時段, 課程內容包含 Programming 與 Computer aided Design 等兩大部分. \n Programming 部分包含計算機程式與網際內容管理等課程的內容: Brython, Python, Lua 與 C/C++ 等程式的編寫與 Github 整合應用. \n Computer aided Design 部分包含電腦輔助設計與實習課程的內容: Solvespace (C++), Siemens Solid Edge (Python), Siemens NX (Python), Onshape (Featurescript), CoppeliaSim (Lua, Python, C++) 與 Webots (Python, C++) 等套件的應用. \n 課程評分: 線上測驗 (50%), 出席、協同專案與自我評量 (50%). \n 建立倉儲: \n 將\xa0 https://github.com/mdecycu/cmsimde \xa0 作為倉儲的 cmsimde 目錄, 並從 up_dir 取出所有檔案放入 2a-pj1agx 倉儲的根目錄, 則可以 cms 啟動 dynamic site, 並將 token 放入 .git/config 中的 URL, 就可直接在動態網頁中進行改版, 以 generate_pages 轉為靜態後, 直接以 acp 進行 git add, commit 與 push \n', 'tags': '', 'url': 'About.html'}, {'title': 'tutorial 1', 'text': '', 'tags': '', 'url': 'tutorial 1.html'}]};